import { React, Component } from 'react';

import { NavLink } from "react-router-dom";
import NavbarData from './NavbarData';

import './styles/Header.css';
import './styles/Actions.css';
import './styles/Logo.css';
import './styles/Navigation.css';


class Header extends Component {
    render() {
        const Navbar = NavbarData.map(({title,url},index) => {
            <li key={index}><NavLink exact to="product/{url}">All</NavLink></li>
        })
      return (
        <div className='header'>
            <div className='navigation'>
              <li><NavLink exact to="/product/all">All</NavLink></li>
              <li><NavLink exact to={"/product/tech"}>technologies</NavLink></li>
              <li><NavLink exact to={"/product/clothes"}>clothes</NavLink></li>
            </div>

            <div className='logo'>
                <img alt='logo' src='./a-logo.png' />
            </div>

            <div className='actions'>
            <select>
              
            </select>
                <li><i className="fas fa-shopping-cart"></i></li>
            </div>

        </div>
      ) 
    }
  }

  export default Header;
